import { StatusBar } from 'expo-status-bar';
import { useState } from 'react';
import { StyleSheet, Text, View, TouchableOpacity } from 'react-native';

export default function App() {

  const [buttoner, setButtoner] = useState(0)

  if (button == 1) {
    return (
      <View style={styles.container}>
        <Text style={styles.instructions}>Pressed!</Text>
        <StatusBar style="auto" />

        <TouchableOpacity onPress={() => setButtoner(0)} style={styles.button_one}>
          <Text style={styles.button_text}>Press Me!</Text>
        </TouchableOpacity>
      </View>
    );
  } else {

  return (
    <View style={styles.container}>
      <Text style={styles.instructions}>Press the button!</Text>
      <StatusBar style="auto" />

      <TouchableOpacity onPress={() => setButtoner(1)} style={styles.button_one}>
        <Text style={styles.button_text}>Press Me!</Text>
      </TouchableOpacity>
    </View>
  );
  }
}



const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#fff',
    alignItems: 'center',
    justifyContent: 'center',
  },
  instructions: {
    color: '#888',
    fontSize: 18,
    marginHorizontal: 15,
    marginBottom: 10,
  },
  button_one: {
    backgroundColor: '#bd1',
    padding: 20,
    borderRadius: 5,
  },
  button_text: {
    fontSize: 20,
    color: '#fff',
  }
});
